import React from "react";
import { Provider } from "react-redux";
import store from "./redux/store";
import Navbar from "./components/Navbar";
import Dashboard from "./components/Dashboard";

const App = () => (
  <Provider store={store}>
    <Navbar />
    <Dashboard />
  </Provider>
);

export default App;
